import React from 'react';
import styled from 'styled-components';

const FullScreen = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
  backgrountColor: red
`;

const MainLayout = ({ children }) => <FullScreen>{children}</FullScreen>;

export default MainLayout;
